import React, { useMemo} from 'react'
import { useTable, useSortBy, useGlobalFilter, useFilters, usePagination } from 'react-table'
import MOCK_DATA from './MOCK_DATA.json'
import { COLUMNS } from './columns'
import SortAZ from '../SVG/SortAZ';
import SortZA from '../SVG/SortZA';
import { GlobalFilter } from './GlobalFilter';
import { ColumnFilter } from './ColumnFilter';
import PushLeft from '../SVG/PushLeft';
import PushRight from '../SVG/PushRight';
import FirstPage from '../SVG/FirstPage';
import LastPage from '../SVG/LastPage';
export const BasicTable = () => {
    const columns = useMemo(() => COLUMNS, []);
    const data = useMemo(() => MOCK_DATA, []);

    const { getTableProps, getTableBodyProps, headerGroups, page, nextPage, previousPage, canPreviousPage, canNextPage, pageOptions, prepareRow, state, setGlobalFilter, gotoPage, pageCount, setPageSize } = useTable({
        columns,
        data,
      },
      useFilters,
      useGlobalFilter,
    useSortBy,
    usePagination);
    
    const { globalFilter, pageIndex, pageSize} = state

    return (
      <div className="flex flex-row min-h-screen py-8 bg-gray-300">
      <div className="bg-white rounded-lg w-2/12  p-8 shadow-lg w-60 py-2 place-items-start mx-4 absolute">
  <h1 className="py-2 text-gray-800 font-bold">Фильтр</h1>
  <GlobalFilter filter={globalFilter} setFilter={setGlobalFilter}/>
  <ColumnFilter column={headerGroups[0].headers[4]}/>
</div>
        <div className="bg-white rounded-lg mx-auto w-5/8  p-8 shadow-lg ">
        <div className="flex justify-center bg-white rounded-lg p-2">
</div>
          <div className="w-full mx-auto">
          
            <table
              {...getTableProps}
              className="w-full table-auto border-collapse rounded-lg overflow-hidden"
            >
              <thead className="text-black">
                {headerGroups.map((headerGroup, index) => (
                  <tr key={index} {...headerGroup.getHeaderGroupProps()}>
                    {headerGroup.headers.map((column, index) => (
                      <th
                        key={index}
                        {...column.getHeaderProps(column.getSortByToggleProps())}
                        className={`justify-between px-4 py-2 font-bold bg-yellow-500 text-left ${
                          index === 0 ? 'rounded-l-lg' : ''
                        } ${index === headerGroup.headers.length - 1 ? 'rounded-r-lg' : ''}`}
                      >
                        {column.render('Header')}
                        {/* <div>{column.canFilter?column.render('Filter'):null}</div> */}
                        {column.isSorted? column.isSortedDesc? <SortAZ />: <SortZA />:''}
                      </th>
                    ))}
                  </tr>
                ))}
              </thead>
              <tbody {...getTableBodyProps} className="text-gray-800">
                {page.map((row, index) => {
                  prepareRow(row);
                  return (
                    <tr
                      key={index}
                      {...row.getRowProps()}
                      className={`${
                        index % 2 === 1 ? 'bg-gray-200' : 'bg-white'
                      } hover:bg-yellow-500 transition-colors duration-300`}
                    >
                      {row.cells.map((cell, index) => {
                        return (
                          <td
                            key={index}
                            {...cell.getCellProps()}
                            className={`px-4 py-2 text-left ${
                              index === 0 ? 'rounded-l-lg' : ''
                            } ${index === row.cells.length - 1 ? 'rounded-r-lg' : ''}`}
                          >
                            {cell.render('Cell')}
                          </td>
                        );
                      })}
                    </tr>
                  );
                })}
              </tbody>
            </table>
            <div className='flex justify-center items-center'>
              <span>
                Страница{' '}
                <strong>
                  {pageIndex + 1} из {pageOptions.length}
                </strong>
                {' '}
              </span>
              <select value={pageSize} onChange={e => setPageSize(Number(e.target.value))}>
                {
                  [10, 25, 50].map(pageSize =>(
                      <option key = {pageSize} value={pageSize}>
                        Show {pageSize}
                      </option>
                  ))
                }
              </select>
              <button onClick={()=> gotoPage(0)} disabled={!canPreviousPage}><FirstPage/></button>
              <button onClick={()=> previousPage()} disabled={!canPreviousPage}><PushLeft/></button>
              <button onClick={()=> nextPage()} disabled={!canNextPage}><PushRight/></button>
              <button onClick={()=> gotoPage(pageCount-1)} disabled={!canNextPage}><LastPage/></button>
            </div>
          </div>
        </div>
      </div>
    );
  };
